static real32_T rt_powf_snf_m(real32_T u0, real32_T u1, DW_TwoMassID_t
  *rtTwoMassID_DW)
{
  real32_T y;
  if (rtIsNaNF(u0) || rtIsNaNF(u1)) {
    y = (rtNaNF);
  } else {
    rtTwoMassID_DW->f = fabsf(u0);
    rtTwoMassID_DW->f1 = fabsf(u1);
    if (rtIsInfF(u1)) {
      if (rtTwoMassID_DW->f == 1.0F) {
        y = 1.0F;
      } else if (rtTwoMassID_DW->f > 1.0F) {
        if (u1 > 0.0F) {
          y = (rtInfF);
        } else {
          y = 0.0F;
        }
      } else if (u1 > 0.0F) {
        y = 0.0F;
      } else {
        y = (rtInfF);
      }
    } else if (rtTwoMassID_DW->f1 == 0.0F) {
      y = 1.0F;
    } else if (rtTwoMassID_DW->f1 == 1.0F) {
      if (u1 > 0.0F) {
        y = u0;
      } else {
        y = 1.0F / u0;
      }
    } else if (u1 == 2.0F) {
      y = u0 * u0;
    } else if ((u1 == 0.5F) && (u0 >= 0.0F)) {
      y = sqrtf(u0);
    } else if ((u0 < 0.0F) && (u1 > floorf(u1))) {
      y = (rtNaNF);
    } else {
      y = powf(u0, u1);
    }
  }

  return y;
}

static real32_T rt_hypotf_snf_m(real32_T u0, real32_T u1, DW_TwoMassID_t
  *rtTwoMassID_DW)
{
  real32_T y;
  rtTwoMassID_DW->a = fabsf(u0);
  y = fabsf(u1);
  if (rtTwoMassID_DW->a < y) {
    rtTwoMassID_DW->a /= y;
    y *= sqrtf(rtTwoMassID_DW->a * rtTwoMassID_DW->a + 1.0F);
  } else if (rtTwoMassID_DW->a > y) {
    y /= rtTwoMassID_DW->a;
    y = sqrtf(y * y + 1.0F) * rtTwoMassID_DW->a;
  } else if (!rtIsNaNF(y)) {
    y = rtTwoMassID_DW->a * 1.41421354F;
  }

  return y;
}

