static void inv(const real32_T x[4], real32_T y[4], DW_TwoMassID_t
                *rtTwoMassID_DW)
{
  if (fabsf(x[1]) > fabsf(x[0])) {
    rtTwoMassID_DW->r = x[0] / x[1];
    rtTwoMassID_DW->t = 1.0F / (rtTwoMassID_DW->r * x[3] - x[2]);
    y[0] = x[3] / x[1] * rtTwoMassID_DW->t;
    y[1] = -rtTwoMassID_DW->t;
    y[2] = -x[2] / x[1] * rtTwoMassID_DW->t;
    y[3] = rtTwoMassID_DW->r * rtTwoMassID_DW->t;
  } else {
    rtTwoMassID_DW->r = x[1] / x[0];
    rtTwoMassID_DW->t = 1.0F / (x[3] - rtTwoMassID_DW->r * x[2]);
    y[0] = x[3] / x[0] * rtTwoMassID_DW->t;
    y[1] = -rtTwoMassID_DW->r * rtTwoMassID_DW->t;
    y[2] = -x[2] / x[0] * rtTwoMassID_DW->t;
    y[3] = rtTwoMassID_DW->t;
  }
}

